<script>
  var i, label, result, callback;
  result = jQuery.map([3, 4, 5], function(v, k)
  {
    return k;
  });
  assertEquals(result.join(""), "012", "Map the keys from an array");
  result = jQuery.map([3, 4, 5], function(v)
  {
    return v;
  });
  assertEquals(result.join(""), "345", "Map the values from an array");
  result = jQuery.map({a: 1, b: 2}, function(v, k)
  {
    return k;
  });
  assertEquals(result.join(""), "ab", "Map the keys from an object");
  result = jQuery.map({a: 1, b: 2}, function(v)
  {
    return v;
  });
  assertEquals(result.join(""), "12", "Map the values from an object");
  result = jQuery.map(["a", undefined, null, "b"], function(v)
  {
    return v;
  });
  assertEquals(result.join(""), "ab", "Array iteration does not include undefined/null results");
  result = jQuery.map({
    a: "a", 
    b: undefined, 
    c: null, 
    d: "b"
  }, function(v)
  {
    return v;
  });
  assertEquals(result.join(""), "ab", "Object iteration does not include undefined/null results");
  result = {
    Zero: function(){}, 
    One: function(a){}, 
    Two: function(a, b){}
  };
  callback = function(v, k)
  {
    assertEquals(k, "foo", label + "-argument function treated like object");
  };
  for(i in result)
  {
    label = i;
    result[i].foo = "bar";
    jQuery.map(result[i], callback);
  }

  result = {
    "undefined": undefined, 
    "null": null, 
    "false": false, 
    "true": true, 
    "empty string": "", 
    "nonempty string": "string", 
    "string \"0\"": "0", 
    "negative": -1, 
    "excess": 1
  };
  callback = function(v, k)
  {
    assertEquals(k, "length", ("Object with " + label) + " length treated like object");
  };
  for(i in result)
  {
    label = i;
    jQuery.map({
      length: result[i]
    }, callback);
  }

  result = {
    "sparse Array": Array(4), 
    "length: 2 plain object": {length: 2, "0": true, "1": true}
  };
  callback = function(v, k)
  {
    if(result[label])
    {
      delete (result[label]);
      assertEquals(k, "0", label + " treated like array");
    }
  };
  for(i in result)
  {
    label = i;
    jQuery.map(result[i], callback);
  }

  result = false;
  assert(!result, "length: 0 plain object treated like array");
  result = false;
  assert(!result, "empty NodeList treated like array");
  result = jQuery.map(Array(4), function(v, k)
  {
    return k % 2 ? k : [k, k, k];
  });
  assertEquals(result.join(""), "00012223", "Array results flattened (#2616)");
</script>


</body>
